export function cast(
    args: {inputs: CastInputs, attrs: CastAttrs, backend: BackendWasm}):
    TensorInfo {
  const {inputs: {x}, attrs: {dtype}, backend} = args;
  const out = backend.makeOutput(x.shape, dtype);
