  attrs: NamedAttrMap,
  backend: BackendWasm
}) {
  const {inputs, attrs} = args;
  const {x} = inputs as {} as ReshapeInputs;
  const {shape} = attrs as {} as ReshapeAttrs;
  return {dataId: x.dataId, shape, dtype: x.dtype};
}

